import React from 'react';

console.clear();

const slides = [
  {
    name: "Harambe",
    species: "Gorilla gorilla gorilla (Western Lowland Gorilla)",
    sex: "Male",
    age: "17",
    image: "https://unsplash.com/photos/a-gorilla-sitting-on-top-of-a-rock-next-to-a-waterfall-v7HgfgFsOb4"
  },
  {
    name: "John Porkington",
    species: "Sus Domesticus (Domestic Pig)",
    sex: "Male",
    age: "5",
    image: "https://unsplash.com/photos/pig-lies-on-ground-CP9GGy_LkIY"
  },
  {
    name: "Frederick Leopold Fazbearington",
    species: "Ursus Arctos Horribilis (Grizzly Bear)",
    sex: "Male",
    age: "21",
    image: "https://unsplash.com/photos/brown-bear-sitting-on-grass-field-y421kXlUOQk",
  }

];

function useTilt(active) {
  const ref = React.useRef(null);

  React.useEffect(() => {
    if (!ref.current || !active) {
      return;
    }

    const state = {
      rect: undefined,
      mouseX: undefined,
      mouseY: undefined
    };

    let el = ref.current;

    const handleMouseMove = (e) => {
      if (!el) {
        return;
      }
      if (!state.rect) {
        state.rect = el.getBoundingClientRect();
      }
      state.mouseX = e.clientX;
      state.mouseY = e.clientY;
      const px = (state.mouseX - state.rect.left) / state.rect.width;
      const py = (state.mouseY - state.rect.top) / state.rect.height;

      el.style.setProperty("--px", px);
      el.style.setProperty("--py", py);
    };

    el.addEventListener("mousemove", handleMouseMove);

    return () => {
      el.removeEventListener("mousemove", handleMouseMove);
    };
  }, [active]);

  return ref;
}

const init = {
  slideIndex: slides[0]
}

const slideReducer = (state, event) => {
  if (event.type === 'NEXT') {
    return {
      ...state,
      slideIndex: (state.slideIndex + 1) % slides.length
    }
  }
  if (event.type === 'PREV') {
    return {
      ...state,
      slideIndex: state.slideIndex === 0 ? state.slideIndex - 1:
    state.slideIndex - 1  
    };
  }
};

function Slide({ slide, offset }) {
  const active = offset === 0 ? true : null;
  const ref = useTilt(active);

  return (
    <div
      ref={ref}
      className="slide"
      data-active={active}
      style={{
        "--offset": offset,
        "--dir": offset === 0 ? 0 : offset > 0 ? 1 : -1
      }}
    >
      <div
        className="slideBackground"
        style={{
          backgroundImage: `url('${slide.image}')`
        }}
      />
      <div
        className="slideContent"
        style={{
          backgroundImage: `url('${slide.image}')`
        }}
      >
        <div className="slideContentInner">
          <h2 className="slideName">{slide.name}</h2>
          <h3 className="slideSpecies">{slide.species}</h3>
          <h3 className="slideSex">{slide.sex}</h3>
          <h3 className="slideAge">{slide.age}</h3>
        </div>
      </div>
    </div>
  );
}

function HomePage() {
  const [state,dispatch] = React.useReducer(slideReducer, init);
  
  return (
    <div className="slides">
      <h4>Homepage</h4>
      <h1>Big Cats Rescue</h1>
      <button onClick={() => dispatch({ type: "PREV" })}>‹</button>

      {[...slides, ...slides, ...slides].map((slide, i) => {
        let offset = slides.length + (state.slideIndex - i);
        return <Slide slide={slide} offset={offset} key={i} />;
      })}
      <button onClick={() => dispatch({ type: "NEXT" })}>›</button>
    </div>
  );
}

export default HomePage;
